import React, {Fragment} from 'react'
import styles from './Meals.module.css'


const MealItem = () =>{

    const allMeals = [
        {
            id: 'meal1',
            name: 'Pizza',
            description: 'the perfect italian way',
            price: '14.99'
        },
        {
            id: 'meal2',
            name: 'Bibimbap',
            description: 'the tase of korea',
            price: '13.99'
        },
        {
            id: 'meal3',
            name: 'Tacos',
            description: 'awesome mexican food',
            price: '12.99'
        }
    ]

    console.log(allMeals)




    return (
        <Fragment>
            <div className={styles.mealItemContainer}>

                <ul>
                    {allMeals.map(meal => (
                        <li>
                            <h1> {meal.name}</h1>
                            <h2> {meal.description}</h2>
                            <h2> {meal.price}</h2>
                        </li>
                    ))}
                </ul>

            </div>

        </Fragment>
    )
}

export default MealItem;
